INSERT INTO `blogs` (`id`, `title`, `tags`, `content`, `photo`, `posted`, `date`, `author`, `category`) VALUES
(20, 'ARC project: T1 Quantitative analysis report', 'ARC project: T1 Quantitative analysis re', '<p class=\"MsoNormal\" style=\"text-align:center;line-height:150%\" align=\"center\"><a name=\"_Toc86176527\"><b><span style=\"font-size:16.0pt;line-height:150%;\r\nfont-family:\" times=\"\" new=\"\" roman\",serif;color:#1f4e79;mso-themecolor:accent5;=\"\" mso-themeshade:128\"=\"\">ADDIS CONTINENTAL INSTITUTE OF PUBLIC HEALTH</span></b></a></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;line-height:150%\" align=\"center\"><span style=\"mso-bookmark:_Toc86176527\"><b><span style=\"font-size:16.0pt;line-height:\r\n150%;font-family:\" times=\"\" new=\"\" roman\",serif;color:#1f4e79;mso-themecolor:accent5;=\"\" mso-themeshade:128\"=\"\">&nbsp;</span></b></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;line-height:150%\" align=\"center\"><span style=\"mso-bookmark:_Toc86176527\"><b><span style=\"font-size:16.0pt;line-height:\r\n150%;font-family:\" times=\"\" new=\"\" roman\",serif;color:#1f4e79;mso-themecolor:accent5;=\"\" mso-themeshade:128\"=\"\">&nbsp;</span></b></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;line-height:150%\" align=\"center\"><span style=\"mso-bookmark:_Toc86176527\"><b><span style=\"font-size:16.0pt;line-height:\r\n150%;font-family:\" times=\"\" new=\"\" roman\",serif;color:#1f4e79;mso-themecolor:accent5;=\"\" mso-themeshade:128\"=\"\">ARC project: T1 Quantitative analysis report</span></b></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;line-height:150%\" align=\"center\"><span style=\"mso-bookmark:_Toc86176527\"><b><span style=\"font-size:16.0pt;line-height:\r\n150%;font-family:\" times=\"\" new=\"\" roman\",serif;color:#1f4e79;mso-themecolor:accent5;=\"\" mso-themeshade:128\"=\"\">February, 2021</span></b></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"mso-bookmark:_Toc86176527\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"mso-bookmark:_Toc86176527\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"mso-bookmark:_Toc86176527\">&nbsp;</span></p><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357005\"><span style=\"mso-fareast-font-family:\r\n\" calibri=\"\" light\";mso-fareast-theme-font:major-latin;mso-bidi-font-family:\"calibri=\"\" light\";=\"\" mso-bidi-theme-font:major-latin\"=\"\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp; </span></span></span>Background</a></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%;mso-layout-grid-align:none;text-autospace:none\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:\r\n150%;font-family:\" arial\",sans-serif;color:black;mso-themecolor:text1\"=\"\">One key\r\nindicator used to monitor progress towards improving maternal outcomes is\r\nantenatal care (ANC) uptake. Although improvements have been made in the uptake\r\nof at least one ANC contact in Ethiopia, attendance for the recommended number\r\nof contacts has remained suboptimal. According to the 2016 Ethiopia Demographic\r\nand Health Survey (EDHS), the proportion of women age 15-49 who received any\r\nANC from a skilled provider increased from 27% in 2000 to 62% in 2016. However,\r\nonly 32% of women had at least four ANC contacts during their last pregnancy\r\n(CSA Ethiopia &amp; ICF, 2016). Institutional delivery, which has been linked\r\nto the number of ANC contacts, has increased from 5% in 2000 to only 26% in\r\n2016 (EDHS) </span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\r\n\" arial\",sans-serif;mso-fareast-font-family:arial\"=\"\">&nbsp;</span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:10.0pt;text-align:justify;line-height:\r\n150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:150%;font-family:\" arial\",sans-serif;=\"\" mso-fareast-font-family:arial\"=\"\">Phase 2: Baseline (T1) phase</span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\r\n\" arial\",sans-serif;mso-fareast-font-family:arial\"=\"\">After the pilot data\r\ncollection has assured that it’s possible to the implement the study, we now\r\nstart T1 phase within purposively selected three health posts within the\r\ncatchment area of six Health Centers in Amhara region, we will enroll 180 women\r\n(up to 10 per health post x up to 18 health posts)<span style=\"mso-spacerun:yes\">&nbsp; </span>who are 15 years and above <span style=\"letter-spacing:-.1pt\"><span style=\"mso-spacerun:yes\">&nbsp;</span>at the time\r\nof enrolment and whose gestational age is<span style=\"mso-spacerun:yes\">&nbsp;\r\n</span>less than or equal to 20 weeks at the time of enrolment<span style=\"mso-spacerun:yes\">&nbsp;&nbsp; </span>determined by HEWs based on<span style=\"mso-spacerun:yes\">&nbsp; </span>maternal history of<span style=\"mso-spacerun:yes\">&nbsp; </span>last menstrual period (LMP) and<span style=\"mso-spacerun:yes\">&nbsp; </span>quickening(fetal movement felt by the\r\nmother),timing of fetal heart tones(heard using fetoscope), measurement of\r\nfundal height, ultrasound and pregnancy test.<span style=\"mso-spacerun:yes\">&nbsp;\r\n</span>The inclusion and exclusion criteria are presented. </span>Training for\r\ndata collectors and field supervisors was given for four days before data\r\ncollection.<a name=\"_Hlk80879052\"></a></span></span></p>\r\n\r\n<span style=\"mso-bookmark:_Hlk80879052\"></span>\r\n\r\n<h1 style=\"margin-left:36.0pt;text-align:justify;text-indent:-18.0pt;\r\nline-height:normal;mso-list:l3 level1 lfo8\"><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357006\"></a><a name=\"_Toc76456811\"><span style=\"mso-bookmark:_Toc96357006\"><span style=\"font-size:12.0pt;mso-bidi-font-size:16.0pt;font-family:\" arial\",sans-serif;=\"\" mso-fareast-font-family:arial\"=\"\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp; </span></span></span>Objectives\r\nof the study</span></a></span><span style=\"mso-bookmark:_Toc96357006\"></span><span style=\"mso-bookmark:_Toc76456811\"></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:16.0pt;font-family:\" arial\",sans-serif\"=\"\"></span></span></h1>\r\n\r\n<h2><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357007\"></a><a name=\"_Toc76456812\"><span style=\"mso-bookmark:_Toc96357007\">2.1. General\r\nObjectives</span></a></span><span style=\"mso-bookmark:_Toc96357007\"></span><span style=\"mso-bookmark:_Toc76456812\"></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:107%;font-family:\" arial\",sans-serif;=\"\" font-weight:normal\"=\"\"></span></span></h2>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\r\n\" arial\",sans-serif;mso-fareast-font-family:arial;letter-spacing:-.1pt\"=\"\">To assess\r\nthe acceptability, feasibility, and effectiveness of a group antenatal care\r\n(G-ANC) model introduced at the health post level compared to usual antenatal\r\ncare (ANC) among women who report intention to receive ANC at the health post\r\nlevel.</span></span></p>\r\n\r\n<h2 style=\"line-height:115%\"><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357008\"></a><a name=\"_Toc91592172\"><span style=\"mso-bookmark:_Toc96357008\"><span style=\"mso-fareast-font-family:Arial\">2.2. Specific Objectives</span></span></a></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"mso-fareast-font-family:Arial\"></span></span></h2>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo9\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;=\"\" mso-fareast-font-family:\"times=\"\" roman\";color:black\"=\"\"><span style=\"mso-list:\r\nIgnore\">•<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" arial;color:black\"=\"\">To compare the proportion of women who received at least\r\nfour ANC visits between the women receiving the G-ANC intervention and the\r\nroutine ANC service</span></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo9\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;=\"\" mso-fareast-font-family:\"times=\"\" roman\";color:black\"=\"\"><span style=\"mso-list:\r\nIgnore\">•<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" arial;color:black\"=\"\">To compare the proportion of women who deliver at health\r\nfacility between the women receiving the G-ANC intervention and the routine ANC\r\nservice</span></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo9\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;=\"\" mso-fareast-font-family:\"times=\"\" roman\";color:black\"=\"\"><span style=\"mso-list:\r\nIgnore\">•<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" arial;color:black\"=\"\">To compare satisfaction and/or experience of care during ANC\r\nbetween G-ANC client participants and those who receive usual care</span></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo9\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;=\"\" mso-fareast-font-family:\"times=\"\" roman\";color:black\"=\"\"><span style=\"mso-list:\r\nIgnore\">•<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" arial;color:black\"=\"\">To compare reported self-efficacy or empowerment between\r\nG-ANC client participants and those who receive usual car</span></span></p>\r\n\r\n<h1 style=\"margin-left:36.0pt;text-align:justify;text-indent:-18.0pt;\r\nline-height:normal;mso-list:l3 level1 lfo8\"><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357009\"><span style=\"font-size:12.0pt;\r\nfont-family:\" arial\",sans-serif;mso-fareast-font-family:arial\"=\"\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Methodology</a></span><span style=\"mso-bookmark:\r\n_Toc96357009\"></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;font-family:\" arial\",sans-serif\"=\"\"></span></span></h1>\r\n\r\n<p class=\"MsoNormal\"><span style=\"mso-bookmark:_Toc86176527\">&nbsp;</span><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357010\">Study area</a></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\r\n\" arial\",sans-serif;mso-fareast-font-family:arial;letter-spacing:-.1pt\"=\"\">This Baseline\r\n(T1) phase study was conducted in two zones of the Amhara regional state\r\nEthiopia.<span style=\"mso-spacerun:yes\">&nbsp; </span>In West Gojjam Zone (North\r\nAchefer district) and in the South Gondar Zone (Dera, Farta, Limokemkem\r\ndistricts) in six health centers and this baseline phase was conducted at the\r\nhealth post level only.</span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;=\"\" color:black;mso-themecolor:text1\"=\"\">&nbsp;</span></span><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357011\">Study\r\nApproach</a></span><span style=\"mso-bookmark:_Toc96357011\"></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:\r\n107%;font-family:\" arial\",sans-serif\"=\"\"></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\r\n\" arial\",sans-serif;mso-fareast-font-family:arial;letter-spacing:-.1pt\"=\"\">Quantitative\r\nstudy design was conducted from randomly selected 18 health posts in Amhara region\r\nare included in the main study.</span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:150%;font-family:\" times=\"\" new=\"\" roman\",serif;=\"\" color:black;mso-themecolor:text1\"=\"\">&nbsp;</span></span><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357012\">Study\r\nParticipants</a></span><span style=\"mso-bookmark:_Toc96357012\"></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:\r\n107%;font-family:\" arial\",sans-serif\"=\"\"></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\r\n\" arial\",sans-serif;mso-fareast-font-family:arial;letter-spacing:-.1pt\"=\"\">Mothers\r\nwith gestational age less than 20 weeks in 18 health posts under Dera, Farta, <span style=\"mso-spacerun:yes\">&nbsp;</span>Libo Kemekem and North Achefer Health centers.</span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:150%;font-family:\" arial\",sans-serif\"=\"\">&nbsp;</span></span><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96357013\">Sampling\r\nApproach</a></span><span style=\"mso-bookmark:_Toc96357013\"></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:\r\n107%;font-family:\" arial\",sans-serif\"=\"\"></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\r\n\" arial\",sans-serif;mso-fareast-font-family:arial;letter-spacing:-.1pt\"=\"\">For this\r\nparticular study randomly sampling strategy was employed to identify eligible\r\nparticipants in the study area.</span></span></p>\r\n\r\n<h2><span style=\"mso-bookmark:_Toc86176527\">&nbsp;<a name=\"_Toc96357014\">Data\r\nCollection</a></span><span style=\"mso-bookmark:_Toc96357014\"></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;line-height:\r\n107%;font-family:\" arial\",sans-serif\"=\"\"></span></span></h2>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:150%;font-family:\r\n\" arial\",sans-serif;mso-fareast-font-family:arial;letter-spacing:-.1pt\"=\"\">The\r\nstudy used structured questionnaires administered verbally individually by\r\nresearch assistants to collect data from mothers with gestational age less than\r\n20 in 18 health posts under Dera, Farta, Libo Kemekem and North Achefer Health\r\ncenter. In both cases the involvement of Health extension workers, Kebele\r\nadministration, Jhpiego workers, Women Development Army (WDA), traditional\r\nbirth administrations were good coordination and support for data collection. A\r\ntotal of 180 eligible mothers interviewed.<span style=\"mso-spacerun:yes\">&nbsp;\r\n</span>Finally, discussion with the team three new eligible an<a name=\"_Toc87522201\"></a><a name=\"_Toc87880601\"><span style=\"mso-bookmark:_Toc87522201\">d\r\nvoluntary mothers interviewed. </span></a></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:106%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"mso-bookmark:_Toc87880601\"><span style=\"mso-bookmark:_Toc87522201\"><span style=\"font-size:12.0pt;line-height:106%;font-family:\" arial\",sans-serif\"=\"\">&nbsp;</span></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:106%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"mso-bookmark:_Toc87880601\"><span style=\"mso-bookmark:_Toc87522201\"><span style=\"font-size:12.0pt;line-height:106%;font-family:\" arial\",sans-serif\"=\"\"><br></span></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:106%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"mso-bookmark:_Toc87880601\"><span style=\"mso-bookmark:_Toc87522201\"><span style=\"font-size:12.0pt;line-height:106%;font-family:\" arial\",sans-serif\"=\"\"><br></span></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:106%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"mso-bookmark:_Toc87880601\"><span style=\"mso-bookmark:_Toc87522201\"><span style=\"font-size:12.0pt;line-height:106%;font-family:\" arial\",sans-serif\"=\"\"><br></span></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:106%\"><span style=\"mso-bookmark:_Toc86176527\"><span style=\"mso-bookmark:_Toc87880601\"><span style=\"mso-bookmark:_Toc87522201\"><span style=\"font-size:12.0pt;line-height:106%;font-family:\" arial\",sans-serif\"=\"\"><br></span></span></span></span></p>\r\n\r\n<span style=\"mso-bookmark:_Toc87522201\"></span><span style=\"mso-bookmark:_Toc87880601\"></span>\r\n\r\n<p class=\"MsoCaption\"><span style=\"mso-bookmark:_Toc86176527\"><a name=\"_Toc96356345\">Table </a></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"mso-bookmark:_Toc96356345\"><span style=\"mso-no-proof:yes\">1</span></span></span><span style=\"mso-bookmark:\r\n_Toc86176527\"><span style=\"mso-bookmark:_Toc96356345\">: Data collected for\r\nbaseline study</span></span><span style=\"mso-bookmark:_Toc96356345\"></span><span style=\"mso-bookmark:_Toc86176527\"><span style=\"font-size:12.0pt;font-family:\r\n\" times=\"\" new=\"\" roman\",serif;font-style:normal\"=\"\"></span></span></p>\r\n\r\n<table class=\"MsoNormalTable\" style=\"width:510.6pt;margin-left:-.25pt;border-collapse:collapse;mso-yfti-tbllook:\r\n 1184;mso-padding-alt:0cm 5.4pt 0cm 5.4pt\" width=\"0\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;height:15.0pt\">\r\n  <td style=\"width:76.25pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:15.0pt\" width=\"102\" valign=\"bottom\" nowrap=\"\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\n  text-align:center;line-height:normal\" align=\"center\"><span style=\"mso-bookmark:_Toc86176527\"><b><span style=\"mso-ascii-font-family:Calibri;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";=\"\" mso-hansi-font-family:calibri;mso-bidi-font-family:calibri;color:black\"=\"\">Woreda\r\n  </span></b></span></p>\r\n  </td>\r\n  \r\n  <td style=\"width:72.6pt;border:solid windowtext 1.0pt;\r\n  border-left:none;mso-border-left-alt:solid windowtext .5pt;mso-border-alt:\r\n  solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:15.0pt\" width=\"97\" v